import React from 'react';

function Hero() {
  return (
    <header className="hero d-flex align-items-center text-center text-white">
      <div className="container">
        <img
          src="/images/profile-image.jpeg"
          alt="Sujith Nekkanti"
          className="profile-image mb-4"
        />
        <h1>Hi, I'm <span className="text-warning">Sujith Nekkanti</span></h1>
        <p className="lead">M.S. Computer Engineering | Cloud & DevOps Specialist</p>
        <a href="#about" className="btn btn-lg btn-primary mt-3">Learn More</a>
      </div>
    </header>
  );
}

export default Hero;
